import { useCallback } from "react";
import QuoteList from "../components/quotes/QuoteList";
import { addQuote, getAllQuotes } from "../lib/api";
import useHttp from "../hooks/use-http";

let DUMMY_QUOTES = [
  {
    id: "q1",
    author: "Martinaa",
    text: "React is Fun",
  },
  {
    id: "a2",
    author: "Martincho",
    text: "React is Fun",
  },
  {
    id: "q3",
    author: "Martin",
    text: "React is Fun",
  },
];

const AllQuotes = async () => {
  let {
    sendRequest,
    status,
    data: loadedQuotes,
    error,
  } = useHttp(getAllQuotes);
  let result = await getAllQuotes();
  console.log(result);
  return <QuoteList quotes={DUMMY_QUOTES}></QuoteList>;
};

export default AllQuotes;
